;Volkswagen Rhapsody radio (TechniSat)
;Reverse engineered source code
;
;This source code is for the microcontroller in the radio.  It is a
;QFP-80 package and has these markings on the outside:
;
;  M38869FFAHP
;      303B103
;
;The MCU was removed from a radio and dumped using "flash memory mode 1
;(parallel I/O mode)" as described in the Renesas (Mitsubishi) 3886 Group
;datasheet.
;
;Note that the M38869FFAHP has 60K flash ROM total but this source code
;assembles to 48K.  The first 12K (0x1000-0x3FFF) contains all 0xFF.
;
;The hardware and firmware of the Rhapsody radio is very similar to the
;Gamma V radio.  Refer to the Gamma V code when reading this code.  The
;Rhapsody was likely derived from the Gamma V, where the main change
;was to replace the cassette tape player with a single disc CD player.
;
;No rights are claimed on the executable object code as found
;in the internal flash ROM of the M38869FFAHP chip.  The SHA-1
;hash of that binary is: 72680e048db31cd0b9ce1d43d447dc3932db7b76.
;

